import './OptionsMenu1.css';

const OptionsMenu1 = (props) => {
    const { options, menuType } = props;

    return (
        <ul className={`options-menu menu-${menuType}`}>
            {options.map(option => (
                <li className="options-menu-item">{option}</li>
            ))}
        </ul>
    );
};

export default OptionsMenu1;
